package string;

import java.util.HashMap;
import java.util.Map;

public class Anagram {

    static boolean isAnagram(String str1, String str2) {
        if (str1.length() != str2.length()) return false;

        Map<Character, Integer> map = new HashMap<>();

        for (int i = 0; i < str1.length(); i++) {
            if (map.containsKey(str1.charAt(i))) {
                map.put(str1.charAt(i), map.get(str1.charAt(i)) + 1);
            } else {
                map.put(str1.charAt(i), 1);
            }
        }

        Map<Character, Integer> map2 = new HashMap<>();

        for (int i = 0; i < str2.length(); i++) {
            if (map2.containsKey(str2.charAt(i))) {
                map2.put(str2.charAt(i), map2.get(str2.charAt(i)) + 1);
            } else {
                map2.put(str2.charAt(i), 1);
            }
        }

        for (Map.Entry<Character, Integer> objEntry : map.entrySet()) {
            if (objEntry.getValue() != map2.get(objEntry.getKey())) {
                return false;
            }
        }
        return true;
    }

    static boolean efficientWayToCheckAnagram(String str1, String str2) {

        int[] count = new int[256];
        for (int i = 0; i<str1.length(); i++) {
            count[str1.charAt(i)]++;
            count[str2.charAt(i)]--;
        }

        for (int x : count) {
            if (x != 0) return false;
        }

        return true;
    }

    public static void main(String[] args) {

        System.out.println("aab anagram of baa :: " + efficientWayToCheckAnagram("aab", "baa"));
        System.out.println("aab anagram of baa :: " + efficientWayToCheckAnagram("", ""));
    }
}
